webpackJsonp([39042283727807],{7269:function(e,t){e.exports={data:{post:{html:'<p>Tonight is the annual Easter Fire here in town, the biggest event of the year. Like every year, I got a chuckle from the announcement that it would be held at the <em>Flakstellung</em>. There are no signs or anything, you just have to know that that\'s the hill outside of town where the <a href="http://dictionary.reference.com/search?q=flak" title="Dictionary.com/flak"><em>Fl(ieger)a(bwehr)k(anone)</em></a> (anti-aircraft artillery) was located during the war.</p>\n<p>Or just wait until the bonfire is lit, and follow the smoke.</p>',fields:{title:"Meet Us at the Flakstellung",date:"26 Mar 2005",url:"https://papascott.de/2005-03-26-meet-us-at-the-flakstellung/"}}},pathContext:{slug:"/2005-03-26-meet-us-at-the-flakstellung/",prev:{fields:{title:"Flower Pot",date:"26 Mar 2005",slug:"/2005-03-26-flower-pot/"}},next:{fields:{title:"Soccer Made In Germany",date:"26 Mar 2005",slug:"/2005-03-26-soccer-made-in-germany/"}}}}}});
